import React from 'react';
import ReactDOM from 'react-dom';
import Coverflow from 'react-coverflow';
import Music from './Music.png'

const Test = function () {
  /* do your action */
  return (
  <Coverflow className="" width="960" height="400"
    displayQuantityOfSide={1}
    navigation={false}
    enableScroll={true}
    clickable={true}
    active={0}
  >
    <div
      onClick={() => Test()}
      onKeyDown={() => Test()}
      role="menuitem"
      tabIndex="0"
    >
      <img
        src={Music}
        alt='title or description'
        style={{
          display: 'block',
          width: '100%',
        }}
      />
    </div>
    <img src={Music} alt='title or description' data-action="http://andyyou.github.io/react-coverflow/"/>
    <img src={Music} alt='title or description' data-action="http://andyyou.github.io/react-coverflow/"/>
    <img src={Music} alt='title or description' data-action="http://andyyou.github.io/react-coverflow/"/>
    <img src={Divbd} alt='title or description' data-action="http://andyyou.github.io/react-coverflow/"/>
    <img src={Divbd} alt='title or description' data-action="http://andyyou.github.io/react-coverflow/"/>
    <img src={Divbd} alt='title or description' data-action="http://andyyou.github.io/react-coverflow/"/>
  </Coverflow>
  )
    }



export default Test
